Travail sur des algorithmes ;
Formuler des instructions claires dans le but de faire avancer des robots ;
Collaborer avec les membres des autres secteurs ;
Participer à l’amélioration techniques des applications ;
Collaborer avec les développeurs très expérimenté afin d’apprendre de nouveaux outils ;
