Vous accordez beaucoup d’importance à la qualité du code.
Type d'emploi : Temps plein, CDI
Expérience:
développeur back-end node.js h/f ou similaire: 1 an (Souhaité)

Nous recrutons un développeur Python/Golang H/F pour un client final qui est basé en île de France pour un poste en CDI.
Missions du développeur Python/Golang H/F :
Vous pilotez les projets selon coût, délai et fonctionnalité;
Vous serez capable d’identifier les risques et les plans d’actions;
Vous assurerez le développement des projets du Squad ainsi que la gestion des équipes;
Vous serez en charge de respecter les dimensions légales et sécuritaires relatives aux contraintes règlementaires.
