Vous n’hésitez pas à proposer des solutions;
Vous êtes doté d’une réelle capacité de communication et d'écoute;
Vous êtes à l’aise avec le langage Python ou Golang;
La connaissance Container/Docker est un plus;
Vous savez parler et écrire en anglais dans un contexte professionnel;
