développeur python/golang h/f ou similaire: 1 an (Souhaité)

mission
Dans le cadre de la refonte de notre système informatique et dans un contexte de digitalisation de nos métiers, nous recherchons un développeur.
Directement rattaché à la direction de la transformation vous aurez à :
participer à la mise en œuvre d’un nouveau SI CRM et ERP ;
participer à la conception d’un portail web B2C innovant embarquant de l’IA ;
participer à chaque étape de notre projet de transformation digitale de notre entreprise ;
coordonner les métiers dès la phase d’expression des besoins ;
coordonner les tests d’acceptance ;
participer à l’élaboration du modèle de données et de la reprise finale ;
scoring de la base de données, segmentation et ciblages marketing pour accompagner la stratégie commerciale et marketing ;
organiser le maintien en condition opérationnel futur (maintenance évolutive) ;
réaliser les paramétrages fonctionnels de la solution future ;
créer des pages internet, site web, landing page pour accompagner la stratégie commerciale et marketing ;
proposer des solutions digitales innovantes en lien avec la stratégie de l’entreprise.
Votre
profil
Développeur spécialisé sur le paramétrage fonctionnel, le développement de pages Internet et de solution digitales.
Ecole d’ingénieur /Niveau Bac+5 ; organisé(e), curieux(se), motivé(e), force de proposition.
Un première expérience similaire serait un plus, néanmoins, vos facultés d’adaptation et votre autonomie seront déterminantes.
Nous vous
proposons
Rémunération fixe + rémunération variable.
Titres restaurants ; remboursement des frais de transport ; mutuelle/prévoyance et retraite sur complémentaire.
Postuler

Contexte
L'Assurance Retraite, 1ère caisse de retraite en France, est constituée d'une caisse nationale (Cnav) et d'un réseau d'organismes (Carsat, CGSS, CSS). Elle gère la retraite de base des salariés de l'industrie, du commerce et des services (17.5 millions de salariés cotisants, 13.9 millions de retraités, 110.6 milliards d'euros versés chaque année, 13 000 salariés). Pilote du réseau Retraite au niveau national, la Cnav qui compte près de 3500 collaborateurs, assure également des fonctions opérationnelles à travers le traitement des dossiers de ses assurés pour l'ensemble de l'Ile de France.
La Direction des Etudes et Développement Nationaux couvre le champ des études et développements Branche Retraite. Elle est structurée en pôles de développements nationaux constitués de ressources Cnav et Carsat et d'un pôle Cnav de pilotage général des Etudes et Développements Nationaux. Les ressources Cnav de réalisation sont réparties sur 2 centres situés à Paris et à Tours en charges des développements sur les processus majeurs du SI Branche.
Mission/Activités
Evoluant au sein des Etudes et Développements - Fonctions Transverses de la Direction des Systèmes d'Information de la CNAV, vous intervenez dans le cadre de projets majeurs du domaine Editique et notamment sur le projet de migration des éditions CNAV sous le nouveau composeur Exstream (OpenText).
Rattaché au Responsable d'équipe Editique, vous répondez aux besoins éditique des différents processus métier (retraite, action sociale, pénibilité, fraude, RH …) en respectant les contraintes globales de l'architecture éditique de la CNAV afin de garantir la meilleure adéquation entre performance, qualité, coût et délai.
Vos expériences significatives dans le domaine éditique vous permettent de porter, dans un nouveau contexte, des solutions innovantes ou déjà éprouvées.
Vous gérez vos projets sur les composantes suivantes :
revue de spécifications avec la MOA ;
participation à l'élaboration de solutions d'architecture fonctionnelle et technique ;
développements de modèles de documents ;
livraison des composants développés ;
suivi / pilotage des travaux des développeurs rattachés au projet éditique ;
suivi / gestion des maintenances évolutive et corrective ;
gestion de la post production ;
assistance auprès des développeurs, intégrateurs et exploitants des différents centres.
Compétences
Vous justifiez d'une expérience avérée de 3 ans minimum dans le développement sous un composeur éditique.
Les qualités nécessaires à la tenue de cet emploi sont :
esprit d'équipe, qualités relationnelles ;
rigueur ;
curiosité technique, force de proposition ;
initiative, autonomie.
Vous maitrisez :
le langage XML ;
le développement sous un composeur éditique ;
les mécanismes de pilotage de la post production, le langage SQL et la connaissance de la solution OpenText Exstream est un plus.
Conditions particulières
Merci de postuler directement et uniquement sur notre site de recrutement en utilisant le lien suivant : http://recrutement.cnav.fr/concepteur-developpeur-editique-hf
Le poste sera positionné niveau VA ou VB selon profil et expérience.

Missions du développeur Java :
Conception et développement des produits ;

Proposer des réalisations puis les tester et les valider ;

Conception des produits sur les marchés financiers ;

Travailler dans une équipe évoluant dans un environnement agile (scrum) ;

Utilisation de Kotlin et Java ;

intégration continue ;

Construction d’application de serveur extensibles fiables et à grand volumes ;

Fournir et recevoir des commentaires par le biais de codes.

Profil recherché Profil du développeur Java :
Formation académique dans l’informatique ;

Expérience de 2 ans minimum dans le développement Java ;

Bien comprendre les concepts ainsi que les composants du serveur ;

Etre capable de produire, développer/concevoir de nouvelles fonctionnalités tout en maintenant les versions en cours ;

Expériences dans certains framework comme (JUnit, Spock, Spek, Tests d’intégration, TDD…);

Avoir des connaissances techniques sur : Java 8, Kotlin Java, Kotlin, Groovy (idéal) ;

Pouvoir utiliser les langages suivants : Git + Gerrit , Jenkins, Gradle, NoSQL et SQL (idéal).
Entreprise Nous recrutons pour un client final un développeur Java (H/F) en région parisienne, pour un poste en CDI, à pourvoir dès que possible.

Nous recrutons un développeur full stack NodeJs/ReactJs.
Il s’agit d’une société internationale qui s’est implantée en Europe et vient d’ouvrir un bureau à Paris. Ils interviendront sur le projet dans le domaine de l’assurance.
En tant que développeur full stack expérimenté, vous travaillerez en équipe avec les technologies NodeJs et ReactJs.
Profil du développeur full stack expérimenté NodeJs/ReactJs:
Avoir une expérience de 5 ans dont 2 ans en NodeJs et ReactJs;
De bonnes connaissances en OAuth et Docker sont nécessaires;
Si vous êtes à l’aise dans un environnement AWS cloud et avez de l'expérience en DevOps se serait un plus;
Une expérience en agile et en TDD est la bienvenue;
Vous maitrisez et avez de l'expérience en SQL ou NoSQL ainsi qu’en REST API developpement/integration;
Être familier avec les outils d’intégration continue;
Un niveau d’anglais technique écrit et oral est requis.
Type d'emploi : Temps plein, CDI
Expérience:
développeur full stack expérimenté nodejs/reactjs h/f ou similaire: 1 an (Souhaité)

Créé en 1988, APRIL est un groupe international de services en assurance implanté dans 28 pays, dont l’ambition est de proposer à ses clients une expérience de l’assurance plus facile et plus accessible. Ses 3 900 collaborateurs conçoivent, distribuent et gèrent des solutions spécialisées d’assurance (santé-prévoyance, dommage, mobilité et protection juridique) ainsi que des prestations d’assistance pour ses partenaires et clients - particuliers, professionnels et entreprises. Coté sur Euronext Paris (Compartiment B), le groupe a réalisé en 2018 un chiffre d’affaires de 997,2 millions d’euros.
Le Pôle Protection Juridique et Assistance du Groupe APRIL est composée de trois sociétés, toutes filiales d’APRIL. Nous mettons en œuvre un dispositif mixte d'assurance et d'assistance qui met à la disposition de nos clients/assurés des spécialistes pour les défendre ou les représenter.
SOLUCIA Protection Juridique, composée d’une quarantaine de collaborateurs, est une compagnie d’assurance agréée en protection juridique, qui conçoit, distribue et gère des contrats de protection et de services juridiques à destination des Particuliers et des Comités d’Entreprise.
JUDICIAL, composée quant à elle d’une soixantaine de collaborateurs, est spécialisée dans l'accompagnement et la protection juridique des dirigeants de TPE/PME.
April Assistance France fait partie d'un des plus grands réseaux international de gestions des sinistres et de l'assistance. Elle a pour mission de mettre en place des moyens humains et technologiques pour apporter des solutions d'assistance.

