Open Digital Education, c’est quoi au juste ?
ODE(pour les intimes) est un réseau social éducatif qui donne un coup de vieux aux Espaces Numériques de Travail ! Notre solution s’inscrit dans l’ère du temps et participe à l’évolution des pratiques pédagogiques, pour favoriser la réussite scolaire des nouvelles générations.
2 millions, c’est le nombre d’élèves qui se connectent à notre réseau, dans l’hexagone et au-delà, pour apprendre autrement, partager, collaborer ensemble… la liste est longue ! Parmi nos solutions, déployées à grande échelle, découvre ONE, l’espace dédié aux écoles primaires, NEO, le réseau social adapté aux collèges et aux lycées, ou encore CCN, la résidence d'artistes en ligne.
Description du poste
Nous avons besoin de toi, au sein de notre pôle “Opérations”, pour contribuer à améliorer notre solution et faire en sorte qu’elle se maintienne à son (très haut) niveau de qualité !
Véritable intermédiaire entre les usages sur le terrain et les développeurs, tu occupes une place centrale et valorisante au sein de l’équipe logicielle. Ta mission principale sera de participer à la l’élaboration et la réalisation des plans de tests, et la mise en place de processus de validation de non-régression (automatisés ou non).
Selon le type de demande, tu pourras être amené à :
Participer à l’élaboration et la réalisation des plans de tests des nouvelles fonctionnalités selon les spécifications fonctionnelles et expressions de besoins fournies ;
Evaluer les risques engendrés par les nouvelles fonctionnalités mises en oeuvre ;
Qualifier l’opportunité de les déployer rapidement ou non ;
Interagir avec les développeurs pour qualifier les problèmes d’ordre fonctionnels ou techniques et définir la meilleur solution à apporter ;
Intervenir sur l’assistance aux utilisateurs lorsque l’activité le nécessite ;
Produire des tutoriels, des manuels ou des guides.
CDI, temps plein, basé à Paris (17ème arrondissement, métro Villiers).
Profil recherché
De formation BAC + 2 minimum, tu es débutant ou disposes d'une première expérience en tant que chargé(e) de recette. Tu es dynamique, tu apprécies le travail en équipe et sait faire preuve de rigueur. Tu as le sens des priorités et tu sais capitaliser/optimiser ton travail pour gagner en efficacité. Tu as le sens du relationnel et des aptitudes en communication orale comme écrite.
La connaissance du secteur de l’éducation, des applications et de la navigation sur le web ou des méthodologies de développement open source serait un plus.
ODE, c’est aussi...
Un environnement de travail attractif, dynamique et innovant ;
Une ambiance de travail studieuse mais décontractée ;
Une entreprise rentable détenue majoritairement par ses fondateurs et salariés ;
Une startup confirmée, en forte croissance, qui permet de nombreuses perspectives d’évolution ;
Un parti pris assumé et revendiqué, celui d’encourager chacun à consacrer 20 % de son temps à la Recherche & Développement, sur des projets choisis par l’équipe (!)
Ref. à rappeler : Op-RE
NB: Les candidatures sans lettre de motivation ne seront pas étudiées
Type d'emploi : Temps plein, CDI
Expérience:
chargé(e) de recette et d'assistance ou similaire: 1 an (Souhaité)

Alain Bensoussan Avocats Lexing, cabinet d’avocats spécialisés dans tous les secteurs des technologies avancées et précurseur de la théorie de la personnalité juridique des robots, recherche un développeur web (H/F) full stack.
Rejoindre le cabinet, c’est intégrer une structure qui a su durablement s’installer à la première place des cabinets spécialisés en technologies de l’information, informatique, internet et télécoms, pas sa taille, ses effectifs, l’originalité de son modèle, son activité et sa notoriété.
C’est aussi partager nos valeurs basées sur le travail d’équipe, l’entraide, le partage des connaissances dans le respect de chacun.
De formation informatique, vous avez une expérience d’au moins deux ans et vous maîtrisez les technologies :
PHP,
Angular 2 ou supérieur ;
MySQL ;
API RESTful ;
CSS3, SCSS ;
Material Design ;
Connaissances de C#, Docker et Microsoft SQL Server sont un plus ;
Vous serez impliqué(e) dans les étapes de conception et de développement, vous réaliserez de nouveaux modules et participerez aux étapes du cycle de validation (conception, développement, tests, validation et support aux utilisateurs).
Vous prendrez en charge les projets dans leur totalité.
Vous êtes dynamique, proactif, vous avez un bon relationnel et une grande capacité d’adaptation, vous aimez le travail en équipe.
Vous voulez partager notre politique du «Stress cool » qui favorise le développement personnel, l’augmentation des connaissances et des performances dont le résultat est la réalisation de produits de très haute compétence.
Type d'emploi : CDI
Expérience:
développeur web full stack (h/f) ou similaire: 1 an (Souhaité)
Lieu:
Paris (Requis)

